    const reader = new FileReader();
    reader.readAsDataURL(file);
    reader.onload = () => resolve(reader.result);
    reader.onerror = reject;
});

function test()
{

    const file = document.querySelector('#myfile').files[0];

    toBase64(file).then(y=>{

        console.log(y);
    })

    alert("Ddd");
}







    </script>

    
</body>
